/**
 * Upper bound for computing the nth prime number.
 *
 * see http://math.univ-lille1.fr/~ramare/TME-EMT/Articles/Art01.html
 *
 * /!\ n = 1 will work only if loglog(0) returns 0
 *
 */

export function __upperbound__(log, loglog) {
	const upperbound = function (n) {
		if (n < 55) {
			return n * (log(n) + loglog(n)) + 3;
		}

		if (n < 39018) {
			return n * (log(n) + loglog(n) - 0.5);
		}

		return n * (log(n) + loglog(n) - 0.9484);
	};

	return upperbound;
}

import {ptoi} from './ptoi.js';
import {itop} from './itop.js';

/**
 * Sieve of Eratosthenes.
 */

export function __eratosthenes__(alloc, fill, get, gothrough, usqrt) {
	const first = 2;

	const eratosthenes = function (n, callback) {
		if (n <= 2) {
			return null;
		}

		const size = ptoi(n);

		const sieve = alloc(size);
		fill(sieve, 0, size, true);

		const m = ptoi(usqrt(n));

		for (let i = ptoi(first); i < m; ++i) {
			if (get(sieve, i)) {
				const p = itop(i);
				callback(p);
				gothrough(sieve, ptoi(p * p), size, p);
			}
		}

		for (let i = m; i < size; ++i) {
			if (get(sieve, i)) {
				callback(itop(i));
			}
		}

		return sieve;
	};

	return eratosthenes;
}

