export function itop23(i) {
	return i % 2 === 0 ? itop230(i) : itop231(i);
}

export function itop230(i) {
	return 6 * (((i / 2) | 0) + 1) - 1;
}

export function itop231(i) {
	return 6 * (((i / 2) | 0) + 1) + 1;
}

