import {ptoi230} from './ptoi230.js';
import {ptoi231} from './ptoi231.js';

export function ptoi23(p) {
	return p % 6 > 4 ? ptoi230(p) : ptoi231(p);
}

export function ptoi230(p) {
	return Math.ceil((p + 1) / 3) - 2;
}

export function ptoi231(p) {
	return Math.ceil((p - 1) / 3) - 1;
}

/**
 * Converts a square Ulam spiral index to an array index.
 *
 */

export function atos(i, n) {
	const s = Math.sqrt(i) | 0;
	const l = s;
	const r = s + 1;
	const L = l * l;
	const R = r * r;
	let x = ((n - 1) / 2) | 0;
	let y = (n / 2) | 0;

	if (s % 2 === 1) {
		if ((i < (L + R) / 2) | 0) {
			x += ((s / 2) | 0) + 1;
			y += ((l / 2) | 0) + L - i;
		} else {
			x -= ((r / 2) | 0) - R + i;
			y -= ((s / 2) | 0) + 1;
		}
	} else if ((i < (L + R) / 2) | 0) {
		x -= (s / 2) | 0;
		y -= ((l / 2) | 0) + L - i;
	} else {
		x += ((r / 2) | 0) + 1 - R + i;
		y += (s / 2) | 0;
	}

	return n * y + x;
}

/**
 * Converts an array index to a square Ulam spiral index.
 *
 */

export function stoa(i, n) {
	let line = (i / n) | 0;
	let col = i % n;

	if (n % 2 === 0) {
		line = n - line - 1;
		col = n - col - 1;
	}

	let side_col = 1;
	let side_line = 1;

	let ring_index;
	if (col < n - line) {
		ring_index = Math.min(line, col);
	} else if (col > line) {
		ring_index = n - col - 1;
		side_line = -1;
	} else {
		ring_index = n - line - 1;
		side_col = -1;
	}

	const sub_size = n - ring_index * 2;

	return (
		sub_size * sub_size -
		(sub_size - 1) * 2 +
		side_line * (line - ring_index) -
		side_col * (col - ring_index) -
		1
	);
}

